 Dial-up Internet access via Bluetooth is not supported. 

 File transfer between Bluetooth and PC requires Bluetooth or a Bluetooth adapter on the PC, and only pictures can be transferred. 

 The phone supports Bluetooth games. This feature is more dependent upon the design of third-party applications. The general steps are as follows: 

1Select to search for other Bluetooth devices in the game; 

2Find a Bluetooth device you connect, and preset the pairing; 

3Start the game;
